import React, { useEffect, useState } from 'react';
import axios from "axios";
// import { Link } from "react-router-dom";

function Products() {

    const [products, setProducts] = useState([])

    useEffect(() => {

        const fetchAllProducts = async () => {

            try {
                const res = await axios.get("http://localhost:8000/products")


                setProducts(res.data);
                // console.log(res.data);

            } catch (err) {
                console.log(err)
            }

        }

        fetchAllProducts();

    })

    return (
        <div>

            {/* HERO SECTION */}
            <section id="heroSection">

                <div class="heroContainer">

                    <p class="heroText">Explore our world of audio</p>

                </div>

                {/* In-Page navigation bar  */}
                <div>
                    <ul class="productsInnerNav">
                        <li class="InnerNav-item"><a href="#proAudioSection" style="text-decoration: none;">Pro Audio</a></li>
                        <li class="InnerNav-item"><a href="#homeAudioSection" style="text-decoration: none;">Home Audio</a></li>
                    </ul>
                </div>

            </section>
            <div className='products'>
                {products.map((product) => (
                    <div className='book' key={product.ID}>
                        <p>{product.productTitle}</p>
                        <p>{product.productDescription}</p>
                        <p>${product.productPrice} USD</p>

                    </div>
                ))}
            </div>

            {/* <button><Link to="/add">Add new book</Link></button> */}
        </div>
    )
}

export default Products
